import React from "react";

class SearchBox extends React.Component {
  render() {
    return (
      <div>
        <style jsx global>{`
            .searchBox {
                height: 300px;
                display: flex;
                align-items: center;
                background-image: url('https://images.pexels.com/photos/999068/pexels-photo-999068.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260');
                justify-content: center;
                background-position: center center;
                background-repeat: no-repeat;
                background-size: cover
            }

            .formContainer {
                background-color: white;
                height: 200px;
                width: 80%;
                display: flex;
                align-items: center;
                justify-content: center;
            }
        }
    `}</style>
        <section className="searchBox">
          <form action="" className="formContainer">
            <label id="origen">Origen</label>
            <input type="text" />
            <label id="destino">Destino</label>
            <input type="text" />
            <label id="startDate">Fecha de salida</label>
            <input type="date" />
            <label id="startEnd">Fecha de Regreso</label>
            <input type="date" />
          </form>
        </section>
      </div>
    );
  }
}

export default SearchBox;
